<!DOCTYPE html>
<html lang="zh-TW">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
    <title>租重點 - 租屋列表</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", "Microsoft JhengHei", Arial, sans-serif;
            background: #f5f7fa;
            color: #333;
        }

        .header {
            background: linear-gradient(135deg, #2196F3 0%, #42A5F5 100%);
            color: white;
            padding: 0 15px;
            height: 56px;
            display: flex;
            align-items: center;
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            z-index: 1000;
            box-shadow: 0 2px 8px rgba(0,0,0,0.15);
        }

        .menu-btn {
            background: none;
            border: none;
            color: white;
            font-size: 24px;
            cursor: pointer;
            padding: 8px;
            margin-right: 12px;
        }

        .header-title {
            font-size: 20px;
            font-weight: 600;
            letter-spacing: 1px;
        }

        .sidebar {
            position: fixed;
            top: 0;
            left: -280px;
            width: 280px;
            height: 100vh;
            background: #1a1a2e;
            transition: left 0.3s ease;
            z-index: 2000;
            overflow-y: auto;
        }

        .sidebar.active {
            left: 0;
        }

        .sidebar-header {
            background: linear-gradient(135deg, #2196F3 0%, #42A5F5 100%);
            padding: 20px;
            color: white;
            font-size: 22px;
            font-weight: 600;
            display: flex;
            align-items: center;
            gap: 12px;
        }

        .sidebar-menu {
            list-style: none;
            padding: 10px 0;
        }

        .sidebar-menu li {
            padding: 15px 20px;
            color: #fff;
            cursor: pointer;
            display: flex;
            align-items: center;
            gap: 12px;
            transition: background 0.3s;
        }

        .sidebar-menu li:hover {
            background: rgba(33, 150, 243, 0.3);
        }

        .sidebar-menu li.active {
            background: #2196F3;
            border-left: 4px solid #64B5F6;
        }

        .overlay {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: rgba(0, 0, 0, 0.5);
            display: none;
            z-index: 1500;
        }

        .overlay.active {
            display: block;
        }

        .container {
            margin-top: 56px;
            padding: 15px;
            max-width: 480px;
            margin-left: auto;
            margin-right: auto;
        }

        .search-box {
            background: white;
            border-radius: 12px;
            padding: 20px;
            margin-bottom: 15px;
            box-shadow: 0 2px 12px rgba(0,0,0,0.08);
        }

        .search-title {
            font-size: 18px;
            font-weight: 600;
            color: #2196F3;
            margin-bottom: 15px;
            display: flex;
            align-items: center;
            gap: 8px;
        }

        .search-input {
            width: 100%;
            padding: 12px 15px;
            border: 1px solid #e0e6ed;
            border-radius: 8px;
            font-size: 14px;
            margin-bottom: 12px;
            transition: border-color 0.3s;
        }

        .search-input:focus {
            outline: none;
            border-color: #2196F3;
        }

        .filter-group {
            margin-bottom: 12px;
        }

        .filter-label {
            font-size: 14px;
            color: #666;
            margin-bottom: 8px;
            display: block;
        }

        select {
            width: 100%;
            padding: 10px 12px;
            border: 1px solid #e0e6ed;
            border-radius: 8px;
            font-size: 14px;
            background: white;
            cursor: pointer;
        }

        .tabs {
            display: flex;
            background: white;
            border-radius: 8px;
            overflow: hidden;
            margin-bottom: 15px;
            box-shadow: 0 2px 8px rgba(0,0,0,0.06);
        }

        .tab {
            flex: 1;
            padding: 12px;
            text-align: center;
            border: none;
            background: white;
            color: #666;
            font-size: 15px;
            cursor: pointer;
            transition: all 0.3s;
        }

        .tab.active {
            background: linear-gradient(135deg, #2196F3 0%, #42A5F5 100%);
            color: white;
            font-weight: 600;
        }

        .house-card {
            background: white;
            border-radius: 12px;
            overflow: hidden;
            margin-bottom: 15px;
            box-shadow: 0 2px 12px rgba(0,0,0,0.08);
            transition: transform 0.3s, box-shadow 0.3s;
        }

        .house-card:active {
            transform: scale(0.98);
        }

        .house-image {
            width: 100%;
            height: 200px;
            object-fit: cover;
            background: #e0e6ed;
        }

        .house-content {
            padding: 15px;
        }

        .house-title {
            font-size: 16px;
            font-weight: 600;
            color: #2196F3;
            margin-bottom: 8px;
        }

        .house-price {
            font-size: 20px;
            font-weight: 700;
            color: #e74c3c;
            margin-bottom: 10px;
        }

        .house-info {
            font-size: 13px;
            color: #666;
            line-height: 1.8;
        }

        .house-info div {
            margin-bottom: 4px;
        }

        .pagination {
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 8px;
            margin: 20px 0;
        }

        .page-btn {
            min-width: 36px;
            height: 36px;
            border: 1px solid #e0e6ed;
            background: white;
            color: #666;
            border-radius: 6px;
            cursor: pointer;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 0.3s;
        }

        .page-btn:hover, .page-btn.active {
            background: #2196F3;
            color: white;
            border-color: #2196F3;
        }

        .icon {
            font-style: normal;
            font-size: 18px;
        }
    </style>
</head>
<body>
    <div class="header">
        <button class="menu-btn" onclick="toggleMenu()">☰</button>
        <div class="header-title">租重點租屋</div>
    </div>

    <div class="sidebar" id="sidebar">
        <div class="sidebar-header">
            <span class="icon">🏠</span>
            租重點
        </div>
        <ul class="sidebar-menu">
            <li class="active"><span class="icon">🏠</span> 租屋列表</li>
            <li><span class="icon">🏡</span> 我的租屋</li>
            <li><span class="icon">☁️</span> 上傳租屋</li>
            <li><span class="icon">✉️</span> 預約列表</li>
            <li><span class="icon">👤</span> 會員中心</li>
            <li><span class="icon">🏢</span> 公司</li>
            <li><span class="icon">📞</span> 聯絡客服</li>
            <li><span class="icon">🚪</span> 登出</li>
        </ul>
    </div>

    <div class="overlay" id="overlay" onclick="toggleMenu()"></div>

    <div class="container">
        <div class="search-box">
            <div class="search-title">
                <span class="icon">🔍</span>
                搜尋條件
            </div>
            <input type="text" class="search-input" placeholder="文字搜尋：捷運,夜市,路段,學校...">

            <div class="filter-group">
                <label class="filter-label">縣市</label>
                <select id="city">
                    <option>縣市不限</option>
                    <option>台北市</option>
                    <option>新北市</option>
                    <option>桃園市</option>
                    <option>台中市</option>
                    <option>台南市</option>
                    <option>高雄市</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">區域</label>
                <select>
                    <option>區域不限</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">類型</label>
                <select>
                    <option>類型不限</option>
                    <option>整層住家</option>
                    <option>獨立套房</option>
                    <option>分租套房</option>
                    <option>雅房</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">特色</label>
                <select>
                    <option>特色不限</option>
                    <option>可養寵物</option>
                    <option>可開伙</option>
                    <option>有車位</option>
                    <option>有管理員</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">格局</label>
                <select>
                    <option>格局不限</option>
                    <option>1房</option>
                    <option>2房</option>
                    <option>3房</option>
                    <option>4房以上</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">型態</label>
                <select>
                    <option>型態不限</option>
                    <option>公寓</option>
                    <option>電梯大樓</option>
                    <option>透天</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">租金</label>
                <select>
                    <option>租金不限</option>
                    <option>0 - 5000 元</option>
                    <option>5000 - 10000 元</option>
                    <option>10000 - 20000 元</option>
                    <option>20000 - 30000 元</option>
                    <option>30000 - 40000 元</option>
                    <option>40000 以上元</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">坪數</label>
                <select>
                    <option>坪數不限</option>
                    <option>10 坪以下</option>
                    <option>10 - 20 坪</option>
                    <option>20 - 30 坪</option>
                    <option>30 - 40 坪</option>
                    <option>40 - 50 坪</option>
                </select>
            </div>

            <div class="filter-group">
                <label class="filter-label">樓層</label>
                <select>
                    <option>樓層不限</option>
                    <option>1 層</option>
                    <option>2 - 6 層</option>
                    <option>6 - 12 層</option>
                    <option>12 層以上</option>
                </select>
            </div>
        </div>

        <div class="tabs">
            <button class="tab active">房屋照片</button>
            <button class="tab">房屋資訊</button>
        </div>

        <div id="housesList"></div>

        <div class="pagination">
            <button class="page-btn">‹</button>
            <button class="page-btn active">1</button>
            <button class="page-btn">2</button>
            <button class="page-btn">3</button>
            <button class="page-btn">4</button>
            <button class="page-btn">...</button>
            <button class="page-btn">119</button>
            <button class="page-btn">›</button>
        </div>
    </div>
